import React, {useState} from "react";

const UserState = () => {
    const [input, setInput] = useState('edj')

    const onChange = (event) => {
        const newVal = event.target.value
        setInput(newVal)
    }

    return (
        <div>
            <h1>{input}</h1>
            <input type='text'  placeholder='Enter text' onChange={onChange}/>
        </div>
    )
}

export default UserState
